
var CORSAIR_COMMAND_WRITE       = 0x07;
var CORSAIR_COMMAND_READ        = 0x0E;
var CORSAIR_COMMAND_STREAM      = 0x7F;

var CORSAIR_LIGHTING_CONTROL_HARDWARE           = 0x01;
var CORSAIR_LIGHTING_CONTROL_SOFTWARE           = 0x02;

var CORSAIR_PROPERTY_SPECIAL_FUNCTION = 0x04;
var CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR         = 0x22;


export function Name() { return "Corsair Glaive RGB Mouse"; }
export function VendorId() { return 0x1b1c; }
export function ProductId() { return 0x1b74; }
export function Publisher() { return "WhirlwindFX"; }
export function Size() { return [3, 3]; }

var vLedNames = ["Mouse"];

var vLedPositions = [[1,1]];

export function LedNames()
{
  return vLedNames;
}

export function LedPositions()
{
  return vLedPositions;
}

function EnableSoftwareControl()
{
    var packet = [];

    // Lighting ctrl packet.
    packet[0x00]           = 0x00;
    packet[0x01]           = CORSAIR_COMMAND_WRITE;
    packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
    packet[0x03]           = CORSAIR_LIGHTING_CONTROL_SOFTWARE;

    // Send.
    device.write(packet, 65);
}


function ReturnToHardwareControl()
{
    var packet = [];

    // Lighting ctrl packet.
    packet[0x00]           = 0x00;
    packet[0x01]           = CORSAIR_COMMAND_WRITE;
    packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
    packet[0x03]           = CORSAIR_LIGHTING_CONTROL_HARDWARE;

    // Send packet.
    device.write(packet, 65);
}


export function Initialize()
{
    EnableSoftwareControl();
}


export function Render()
{
    var packet = []
    packet[0x00]   = 0x00;
    packet[0x01]   = CORSAIR_COMMAND_WRITE;
    packet[0x02]   = CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR;
    packet[0x03]   = 1;
    packet[0x04]   = 0x00;

    // Fetch color at 1,1
    var iX = vLedPositions[0][0];
    var iY = vLedPositions[0][1];
    var col = device.color(iX,iY);

    // Single zone - apply to mouse.
    for(var zone_idx = 0; zone_idx < 1; zone_idx++)
    {
        packet[(zone_idx * 4) + 5] = zone_idx;
        packet[(zone_idx * 4) + 6] = col[0];
        packet[(zone_idx * 4) + 7] = col[1];
        packet[(zone_idx * 4) + 8] = col[2];
    }

    device.write(packet, 65);
}

export function Validate(endpoint)
{
    return endpoint.interface === 1;
}

export function Shutdown()
{
    ReturnToHardwareControl();
}

export function Image() 
{ 
    return ""; 
}
